def _find_triangle(xp, yp, triangles, vertices):

    for triangleIndex in range(len(triangles)):

        vertexName1, vertexName2, vertexName3 = triangles[triangleIndex]

        point1 = vertices[vertexName1][:2]
        point2 = vertices[vertexName2][:2]
        point3 = vertices[vertexName3][:2]

        triangle = (point1, point2, point3)

        if _point_in_triangle(xp, yp, triangle):
            #return (vertices[vertexName1], vertices[vertexName2], vertices[vertexName3])
            return triangleIndex

    return -1

def _point_in_triangle(xp, yp, triangle):

    vertex1, vertex2, vertex3 = triangle

    xa, ya = vertex1
    xb, yb = vertex2
    xc, yc = vertex3

    mt = (yb - yc) * xa - (ya - yc) * xb + (ya - yb) * xc
    ma = (yc - yp) * xb - (yb - yp) * xc + (yb - yc) * xp
    mb = (ya - yp) * xc - (yc - yp) * xa + (yc - ya) * xp
    mc = (yb - yp) * xa - (ya - yp) * xb + (ya - yb) * xp

    lambda1 = ma / mt
    lambda2 = mb / mt
    lambda3 = mc / mt

    in_triangle = (lambda1 >= 0) and (lambda1 <= 1)
    in_triangle = in_triangle and (lambda2 >= 0) and (lambda2 <= 1)
    in_triangle = in_triangle and (lambda3 >= 0) and (lambda3 <= 1)

    return in_triangle

